        <button class="w3-button w3-red" onclick="document.getElementById('left').setAttribute('set_bind','true')">Left</button>
        <button class="w3-button w3-blue" onclick="document.getElementById('right').setAttribute('set_bind','true')">Right</button>
        <button class="w3-button w3-yellow" onclick="updateModel(-1)">Animate Model</button>
    </div>
</div>

</body>

</html>
